import React from "react";

export default function ProductGrid(props) {
  return (
    <div className="panel panel-default" >
      <input
        type="checkbox"
        className="delete-checkbox"
        id={props.ID}
        name="product_ids"
        onChange={props.runHandleCheckboxChange}
        value={props.ID}
      />
      <br />

      {props.sku}
      <br />

      {props.name}
      <br />

      {props.price}
      <br />

      {props.attribute}
    </div>
  );
}
